CREATE DEFINER=`root`@`localhost` PROCEDURE `AssignShiftsToPharmacies`()
BEGIN
    DECLARE done BOOLEAN DEFAULT FALSE;
    DECLARE current_code_id SMALLINT;
    DECLARE current_start_date DATE;
    DECLARE days_in_month INT;
    DECLARE total_pharmacies INT;
    DECLARE per_day INT;
    DECLARE leftover INT;
    DECLARE current_day INT;
    DECLARE required INT;
    DECLARE remaining INT;
    DECLARE shift_id INT;
    DECLARE shift_date DATE;
    
    DECLARE cursor_codes CURSOR FOR SELECT id FROM code WHERE status = 1;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    SET current_start_date = DATE_FORMAT(CURDATE(), '%Y-%m-01');
    SET days_in_month = DAY(LAST_DAY(current_start_date));

    OPEN cursor_codes;
    code_loop: LOOP
        FETCH cursor_codes INTO current_code_id;
        IF done THEN
            LEAVE code_loop;
        END IF;

        -- Obtener farmacias activas y remanentes
        DROP TEMPORARY TABLE IF EXISTS available_pharmacies;
        CREATE TEMPORARY TABLE available_pharmacies (
            id SMALLINT PRIMARY KEY,
            is_carryover BOOLEAN,
            INDEX idx_id (id)
        );

        -- Insertar remanentes del mes anterior
        INSERT IGNORE INTO available_pharmacies
        SELECT cp.pharmacy_id, TRUE
        FROM carryover_pharmacies cp
        WHERE cp.code_id = current_code_id
        AND cp.month_year = current_start_date;

        -- Insertar farmacias activas del cÃ³digo actual (excluyendo ya asignadas)
        INSERT IGNORE INTO available_pharmacies
        SELECT p.id, FALSE
        FROM pharmacy p
        WHERE p.Code_id = current_code_id
        AND p.status = 1
        AND NOT EXISTS (
            SELECT 1 FROM carryover_pharmacies cp
            WHERE cp.pharmacy_id = p.id
            AND cp.code_id = current_code_id
            AND cp.month_year = current_start_date
        )
        AND NOT EXISTS (
            SELECT 1 FROM pharmacy_shift ps
            JOIN shift s ON ps.Shift_id = s.id
            WHERE ps.Pharmacy_id = p.id
            AND MONTH(s.dayShift) = MONTH(current_start_date)
            AND YEAR(s.dayShift) = YEAR(current_start_date)
        );

        -- Calcular asignaciones diarias
        SELECT COUNT(*) INTO total_pharmacies FROM available_pharmacies;
        SET per_day = FLOOR(total_pharmacies / days_in_month);
        SET leftover = total_pharmacies % days_in_month;

        -- Asignar turnos para cada dÃ­a del mes
        SET current_day = 1;
        WHILE current_day <= days_in_month DO
            -- Crear turno si no existe
            SET shift_date = DATE_ADD(current_start_date, INTERVAL (current_day - 1) DAY);
            INSERT IGNORE INTO shift (name, dayShift, status)
            VALUES (CONCAT('Shift ', shift_date), shift_date, 1);

            -- Obtener ID del turno
            SELECT id INTO shift_id FROM shift
            WHERE dayShift = shift_date 
            ORDER BY id LIMIT 1;

            -- Calcular asignaciones para este dÃ­a
            SET required = per_day + IF(current_day <= leftover, 1, 0);
            SELECT COUNT(*) INTO remaining FROM available_pharmacies;

            IF required > 0 AND remaining > 0 THEN
                -- Tabla temporal para selecciÃ³n
                DROP TEMPORARY TABLE IF EXISTS temp_selected_pharmacies;
                CREATE TEMPORARY TABLE temp_selected_pharmacies (
                    id SMALLINT PRIMARY KEY
                );
                
                -- Consulta dinÃ¡mica segura con LIMIT
                SET @sql = CONCAT('INSERT INTO temp_selected_pharmacies 
                                 SELECT id FROM available_pharmacies 
                                 ORDER BY is_carryover DESC, RAND() 
                                 LIMIT ', required);
                PREPARE stmt FROM @sql;
                EXECUTE stmt;
                DEALLOCATE PREPARE stmt;
                
                -- Insertar las asignaciones (ignorando duplicados)
                INSERT IGNORE INTO pharmacy_shift (Shift_id, Pharmacy_id)
                SELECT shift_id, id FROM temp_selected_pharmacies;
                
                -- Eliminar las asignadas
                DELETE a FROM available_pharmacies a
                INNER JOIN temp_selected_pharmacies t ON a.id = t.id;
                
                DROP TEMPORARY TABLE temp_selected_pharmacies;
            END IF;

            SET current_day = current_day + 1;
        END WHILE;

        -- Guardar remanentes para el prÃ³ximo mes (versiÃ³n corregida)
        DELETE FROM carryover_pharmacies
        WHERE code_id = current_code_id
        AND month_year = DATE_ADD(current_start_date, INTERVAL 1 MONTH);

        -- Insertar solo farmacias no asignadas como remanentes (versiÃ³n corregida)
        INSERT INTO carryover_pharmacies (code_id, pharmacy_id, month_year)
        SELECT current_code_id, id, DATE_ADD(current_start_date, INTERVAL 1 MONTH)
        FROM available_pharmacies
        WHERE id NOT IN (
            SELECT ps.Pharmacy_id 
            FROM pharmacy_shift ps
            JOIN shift s ON ps.Shift_id = s.id
            WHERE MONTH(s.dayShift) = MONTH(current_start_date)
            AND YEAR(s.dayShift) = YEAR(current_start_date)
        );

        DROP TEMPORARY TABLE available_pharmacies;
    END LOOP;
    CLOSE cursor_codes;
    
    -- Mensaje de finalizaciÃ³n
    SELECT 'Procedimiento ejecutado correctamente' AS Resultado;
END ;;
