CREATE DEFINER=`root`@`localhost` PROCEDURE `generar_shifts_mensuales`()
BEGIN
    DECLARE fecha_actual DATE;
    DECLARE mes_actual INT;
    DECLARE anio_actual INT;
    DECLARE dias_en_mes INT;
    DECLARE dia INT;
    DECLARE shifts_existentes INT;
    DECLARE fecha_shift DATE;
    DECLARE nombre_shift VARCHAR(45);
    
    -- Obtener fecha actual y componentes
    SET fecha_actual = CURDATE();
    SET mes_actual = MONTH(fecha_actual);
    SET anio_actual = YEAR(fecha_actual);
    
    -- Verificar si ya existen shifts para este mes
    SELECT COUNT(*) INTO shifts_existentes 
    FROM `shift` 
    WHERE MONTH(`dayShift`) = mes_actual 
    AND YEAR(`dayShift`) = anio_actual;
    
    -- Solo continuar si no hay shifts existentes
    IF shifts_existentes = 0 THEN
        -- Calcular dÃ­as en el mes actual
        SET dias_en_mes = DAY(LAST_DAY(fecha_actual));
        
        -- Iniciar transacciÃ³n
        START TRANSACTION;
        
        -- Generar un shift para cada dÃ­a del mes
        SET dia = 1;
        WHILE dia <= dias_en_mes DO
            SET fecha_shift = STR_TO_DATE(CONCAT(anio_actual, '-', mes_actual, '-', dia), '%Y-%m-%d');
            SET nombre_shift = CONCAT('Shift-', dia, '-', LPAD(mes_actual, 2, '0'), '-', anio_actual);
            
            -- Insertar el shift con la estructura de tu tabla
            INSERT INTO `shift` (
                `name`, 
                `Is24Hours`, 
                `dayShift`, 
                `status`, 
                `lastUpdate`
            ) VALUES (
                nombre_shift,    -- name
                0,              -- Is24Hours (0 para falso)
                fecha_shift,     -- dayShift
                1,              -- status (1 para activo)
                NOW()           -- lastUpdate
            );
            
            SET dia = dia + 1;
        END WHILE;
        
        -- Confirmar transacciÃ³n
        COMMIT;
        
        SELECT CONCAT('Ãxito: Se crearon ', dias_en_mes, ' shifts para ', 
               MONTHNAME(fecha_actual), ' ', anio_actual) AS resultado;
    ELSE
        SELECT CONCAT('InformaciÃ³n: Ya existen ', shifts_existentes, ' shifts registrados para ', 
               MONTHNAME(fecha_actual), ' ', anio_actual, '. No se crearon nuevos.') AS resultado;
    END IF;
END ;;
